description:
Verenigde Staten
Animatie
75 minuten

geregisseerd door Cody Cameron
met de stemmen van Ciara Bravo, Karley Scott Collins en Cody Cameron

Het nieuwe avontuur brengt Boog, Elliot en de andere dierenvrienden van het bos naar een circustent. Wanneer Boogs vrienden het jaarlijkse uitstapje van de jongens afzeggen om tijd door te brengen met hun familie, besluit de teleurgestelde beer zelf op pad te gaan. Hij verwisselt van plaats met een grizzly die op hem lijkt en zo belandt hij midden in de ring van een groot circus. Daar valt hij als een blok voor een verleidelijke, Russische artieste, maar langzaamaan beseft Boog dat je misschien niet hoeft te kiezen tussen familie en vriendschap.

Vanaf 4 januari 2011 op video

